import React, { useState } from "react";
import { Route } from "react-router-dom";
import NavWrapper from "./components/NavWrapper";
import Home from "./components/Home";
import { NavInfo } from "./data/data";

function App() {
  const [navInfo] = useState(NavInfo);

  return (
    <div>
      {navInfo ? <NavWrapper navInfo={navInfo} /> : <div>"Loading..."</div>}
      <Route exact path="/" component={Home} />
      {Object.entries(navInfo)[0].map(key => {
        Object.entries(navInfo)[1].map(value => (
          <Route path={`/${key}/${value.split(" ").join("")}`} />
        ));
      })}
    </div>
  );
}

export default App;
